Oggi sono stata invitata da un’amica a condividere con tutti voi il mio incontro con il pranic healing.  Grazie al mio insegnate Michele ho avuto modo , di entrare in contatto e studiare questa meravigliosa disciplina, per il quale sono in cammino di formazione e pian piano inizierò a condividere con tutti voi i suoi benefici. Cos’è Il Pranic Energy Healing? è una forma di trattamento energetico che usa il Prana, l'energia vitale, per il trattamento ed il miglioramento di numerosi disturbi sia fisici che enegetici è si può ricevere sia di persona che a distanza. Ora in brevissimo, ma vi racconto come, in un lungo percorso di crescita personale e guarigione mi sono imbattuta in fortissime crisi di ansia e panico. Ehhh si, anche gli insegnanti di yoga sono umani e soggetti alle turbolenze e giochini che la mente scatena. Grazie a Michele che ha abilmente lavorato da lontano ed alla costanza nella meditatazione per la pace planetaria sono Rinata! Il supporto energetico da subito si è manifestato e la rapidità di guarigione è stata a dir poco sorprendente. La sensazione di calore al cuore e protezione dopo la rimozione di legami negativi e credenze limitanti, paure, mi hanno dato la forza di reagire ad una situazione inaspettata e davvero davvero spaventosa per me che non avevo mai nemmeno considerato poter provare nella mia vita. La catarsi è stata intensa ma la liberazione garantita. Grazie alle mie compagne di corso e cammino per avermi permesso di BUTTARE FUORI ciò che finora mi sembrava troppo da condividere. Se desiderate sperimentare i benefici del Pranic Energy Healing o se avete qualsiasi domanda non esitate a conttarci. La transizione nel percorso di crescita è dura e spesso dolorosa, fidatevi di voi stessi e di terapeuti esperti pronti in qualsiasi ambito a darvi supporto. 
